q = [ ]

def send(msg):
    q.append(msg)

    if len(q) > 1000:
        flush()

def flush():
	buf = ''
	for x in q:
		buf += x+'\n'
	sys.stdout.write(buf)


while True:
    for i in xrange(20000):
        send('2014-01-05 23:07:08 WINDBAG Event 1 of 100000')